messages.html.body:
Locale messages syntax
Structure
Locale Messages syntax the below:
// As Flowtype defnition, Locale Messages syntax like BNF annotation
type LocaleMessages = { [key: Locale]: LocaleMessageObject };
type LocaleMessageObject = { [key: Path]: LocaleMessage };
type LocaleMessageArray = LocaleMessage[];
type LocaleMessage = string | LocaleMessageObject | LocaleMessageArray;
type Locale = string;
type Path = string;

Based on the above syntax, You can configure the following structure Locale Messages:
{
  "en": {  // 'en' Locale
    "key1": "this is message1", // basic
    "nested": { // nested
      "message1": "this is nested message1"
    },
    errors: [ // array
      "this is 0 error code message",
      {  // object in array
         "internal1": "this is internal 1 error message"
      },
      [  // array in array
         "this is nested array error 1"
      ]
    ]
  },
  "ja": { // 'ja' Locale
    // ...
  }
}

In the above Locale Messages structure,  You can translate with using below key paths.


  {{ $t('key1') }}

  {{ $t('nested.message1') }}

  {{ $t('errors[0]') }}

  {{ $t('errors[1].internal1') }}

  {{ $t('errors[2][0]') }}


Ouput the following:


  this is message1

  this is nested message1

  this is 0 error code message

  this is internal 1 error message

  this is nested array error 1


Linked locale messages
If there's a translation key that will always have the same concrete text as another one you can just link to it. To link to another translation key, all you have to do is to prefix its contents with an @: sign followed by the full name of the translation key including the namespace you want to link to.
Locale messages the below:
const messages = {
  en: {
    message: {
      the_world: 'the world',
      dio: 'DIO:',
      linked: '@:message.dio @:message.the_world !!!!'
    }
  }
}

Template the below:
{{ $t('message.linked') }}

Output the below:
DIO: the world !!!!

fallback.html.body:
Fallback localization
The following locale messages that not exist message key in ja locale:
const messages = {
  en: {
    message: 'hello world'
  },
  ja: {
  }
}

When specify the fallbackLocale option to VueI18n constructor option, message key is localized with en locale key:
const i18n = new VueI18n({
  locale: 'ja',
  fallbackLocale: 'en',
  messages
})

Template the below:
{{ $t('message') }}

Output the below:
hello world

component.html.body:
Component based localization
In general, locale info (e.g. locale,messages, etc) is set as constructor option of VueI18n instance and it sets i18n option as root Vue instance. Therefore you can globally translate with using $t or $tc in the root Vue instance and any composed component. 
You can also manage locale info for each component separately, which might be more convenient due to Vues component oriented design.
Component based localization example:
// setup locale info for root Vue instance
const i18n = new VueI18n({
  locale: 'ja',
  messages: {
    en: {
      message: {
        hello: 'hello world',
        greeting: 'good morning'
      }
    },
    ja: {
      message: {
        hello: 'こんにちは、世界',
        greeting: 'おはようございます'
      }
    }
  }
})

// Define component
const Component1 = {
  template: `

     Component1 locale messages: {{ $t("message.hello") }}
     Fallback global locale messages: {{ $t("message.greeting") }}
   `,
  i18n: { // `i18n` option
    messages: {
      en: { message: { hello: 'hello component1' } },
      ja: { message: { hello: 'こんにちは、component1' } }
    }
  }
}

new Vue({
  i18n,
  components: {
    Component1
  }
}).$mount('#app')

Template:

  {{ $t("message.hello") }}



Outputs the following:

  こんにちは、世界

    Component1 locale messages: こんにちは、component1
    Fallback global locale messages: おはよう、世界！



As in the example above, if the component doesn't have the locale message, it falls back to globally defined localization info. The component uses the language set in the root instance (in the above example: locale: 'ja'). 
If you hope localize in the component locale, you can realize with sync: false and locale in i18n option.

directive.html.body:
Custom directive localization

 7.3+

You can translate not only with v-t custom directive, but also with $t method.
String syntax
You can pass the keypath of locale messages with string syntax.
Javascript:
new Vue({
  i18n: new VueI18n({
    locale: 'en',
    messages: {
      en: { hello: 'hi there!' },
      ja: { hello: 'こんにちは！' }
    }
  }),
  data: { path: 'hello' }
}).$mount('#string-syntax')

Templates:







Outputs:

  hi there!
  hi there!


Object syntax
You can use object syntax.
Javascript:
new Vue({
  i18n: new VueI18n({
    locale: 'en',
    messages: {
      en: { hello: 'hi {name}!' },
      ja: { hello: 'こんにちは、{name}！' }
    }
  }),
  computed: {
    nickName () { return 'kazupon' }
  },
  data: { path: 'hello' }
}).$mount('#object-syntax')

Templates:







Outputs:

  こんにちは、kazupon！
  hi kazupon!


$t vs v-t
$t
$t is extended Vue instance method. It has the following pros and cons:
Pros
You can flexibly use mustash syntax {{}} in templates and also computed props and methods in Vue instance.
Cons
$t is executed everytime when re-render occures, so it does have a translation costs.
v-t
v-t is a custom directive. It has the following pros and cons:
Pros
v-t has better performance than the $t method due to its cache with the custom directive, when translated once. Also, pre-translation is possible with the Vue compiler module which was provided by vue-i18n-extensions. Therefore it's possible to make more performance optimizations.
Cons
v-t can not be flexibly used like $t, it's rather complex. The translated content with v-t is inserted into the textContent of the element. Also, when you use server-side rendering, you need to set the custom directive to directives option of  the createRenderer function.

interpolation.html.body:
Component interpolation
Basic Usage

 7.0+

Sometimes, we need to localize with locale message that was included HTML tag or component. For example:
I accept xxx Terms of Service Agreement

In the above message, if you use with $t, probably you may try to compose the following locale messages:
const messages = {
  en: {
    term1: 'I Accept xxx\'s',
    term2: 'Terms of Service Agreement'
  }
}

And in the following, you may try to implement in template:
{{ $t('term1') }}{{ $t('term2') }}

output:
I accept xxx Terms of Service Agreement

This is very cumbersome, and if you configure the  tag in a locale message, there is a possibility XSS vulnerabilities due to localize with v-html="$t('term')".
You can avoid it with using i18n functional component. For example:



    {{ $t('tos') }}




const messages = {
  en: {
    tos: 'Term of Service',
    term: 'I accept xxx {0}.'
  },
  ja: {
    tos: '利用規約',
    term: '私は xxx の{0}に同意します。'
  }
}

const i18n = new VueI18n({
  locale: 'en',
  messages
})
new Vue({
  i18n,
  data: {
    url: '/term'
  }
}).$mount('#app')

the following ouput:



    I accept xxx Term of Service.




About the above example, see the example
The children of i18n functional component is interpolated with locale message of path prop. In the above example, {{ $t('tos') }} is interplated with term locale message.
In above example, the component interpolation follows the list formatting. The children of i18n functional component are interpolated by their orders of appearance.
Advanced Usage

 7.2+
 NOTE: In i18n component, text content consists of only white spaces will be omitted.

Named formatting is supported with the help of place attribute. For example:



    {{ changeLimit }}
    {{ $t('change') }}




const messages = {
  en: {
    info: 'You can {action} until {limit} minutes from departure.',
    change: 'change your flight',
    refund: 'refund the ticket'
  }
}

const i18n = new VueI18n({
  locale: 'en',
  messages
})
new Vue({
  i18n,
  data: {
    changeUrl: '/change',
    refundUrl: '/refund',
    changeLimit: 15,
    refundLimit: 30
  }
}).$mount('#app')

Outputs:



    You can change your flight until 15 minutes from departure.





 NOTE: To use named formatting, all children of i18n component must have place attribute set. Otherwise it will fallback to list formatting.

If you still want to interpolate text content in named formatting, you could define places property on i18n component. For example:



    {{ $t('refund') }}




Outputs:



    You can refund your ticket until 30 minutes from departure.

sfc.html.body:
Single file components
Basic Usage
If you are building Vue component or Vue application with using single file components, you can manage the locale messages i18n custom block.
The following in single file components example:

{
  "en": {
    "hello": "hello world!"
  },
  "ja": {
    "hello": "こんにちは、世界！"
  }
}




    locale

      en
      ja

    message: {{ $t('hello') }}




export default {
  name: 'app',
  data () { return { locale: 'en' } },
  watch: {
    locale (val) {
      this.$i18n.locale = val
    }
  }
}


Installing vue-i18n-loader
You need to install vue-loader and vue-i18n-loader due to use  custom blocks. While vue-loader most likely is already used in your project if you are working with single file components, you must install vue-i18n-loader additionally:
$ npm i --save-dev @kazupon/vue-i18n-loader
Webpack
For Webpack the configuration below is required:
module.exports = {
  // ...
  module: {
    rules: [
      {
        test: /\.vue$/,
        loader: 'vue-loader',
        options: {
          loaders: {
            // you need to specify `i18n` loaders key with `vue-i18n-loader` (https://github.com/kazupon/vue-i18n-loader)
            i18n: '@kazupon/vue-i18n-loader'
          }
        }
      },
      // ...
    ]
  },
  // ...
}

Vue CLI 3.0 (beta)
Vue-cli 3.0 hides the webpack configuration, so, if we want to add support to the  tag inside a single file component we need to modify the existing configuration.
In order to do that we have to create a vue.config.js at the root of our project. Once done that, we have to include the following:
const merge = require('deepmerge')

module.exports = {
  chainWebpack: config => {
    config.module
      .rule('vue')
      .use('vue-loader')
      .tap(options =>
        merge(options, {
          loaders: {
            i18n: '@kazupon/vue-i18n-loader'
          }
        })
      )
  }
}

Don't forget to install deepmerge! (npm i deepmerge -D or yarn add deepmerge -D)
If you want to read more about modifying the existing configuration click here.
Laravel-Mix
Laravel mix has its own rules for .vue files. To add the vue-i18n-loader, add the following to webpack.mix.js
mix.webpackConfig({
    // ...
    module: {
        rules: [
            {
                // Rules are copied from laravel-mix@1.5.1 /src/builder/webpack-rules.js and manually merged with the ia8n-loader. Make sure to update the rules to the latest found in webpack-rules.js
                test: /\.vue$/,
                loader: 'vue-loader',
                exclude: /bower_components/,
                options: {
                    // extractCSS: Config.extractVueStyles,
                    loaders: Config.extractVueStyles ? {
                        js: {
                            loader: 'babel-loader',
                            options: Config.babel()
                        },

                        scss: vueExtractPlugin.extract({
                            use: 'css-loader!sass-loader',
                            fallback: 'vue-style-loader'
                        }),

                        sass: vueExtractPlugin.extract({
                            use: 'css-loader!sass-loader?indentedSyntax',
                            fallback: 'vue-style-loader'
                        }),

                        css: vueExtractPlugin.extract({
                            use: 'css-loader',
                            fallback: 'vue-style-loader'
                        }),

                        stylus: vueExtractPlugin.extract({
                            use: 'css-loader!stylus-loader?paths[]=node_modules',
                            fallback: 'vue-style-loader'
                        }),

                        less: vueExtractPlugin.extract({
                            use: 'css-loader!less-loader',
                            fallback: 'vue-style-loader'
                        }),

                        i18n: '@kazupon/vue-i18n-loader',
                    } : {
                        js: {
                            loader: 'babel-loader',
                            options: Config.babel()
                        },

                        i18n: '@kazupon/vue-i18n-loader',
                    },
                    postcss: Config.postCss,
                    preLoaders: Config.vue.preLoaders,
                    postLoaders: Config.vue.postLoaders,
                    esModule: Config.vue.esModule
                }
            },
            // ...
        ]
    },
    // ...
});

YAML loading
i18n custom blocks need to specify JSON format, also you can use YAML format by using pre-loader feature of vue-loader.
the i18n custom blocks below of YAML format:

en:
  hello: "hello world!"
ja:
  hello: "こんにちは、世界！"


Webpack conf the below:
module.exports = {
  // ...
  module: {
    rules: [
      {
        test: /\.vue$/,
        loader: 'vue-loader',
        options: {
          preLoaders: {
            i18n: 'yaml-loader'
          },
          loaders: {
            i18n: '@kazupon/vue-i18n-loader'
          }
        }
      },
      // ...
    ]
  },
  // ...
}

Multiple custom blocks
you can be used the locale messages with multiple i18n custom block.


{
  "en": {
    "hello": "hello world!"
  },
  "ja": {
    "hello": "こんにちは、世界！"
  }
}


In the above, first custom block load the common locale message with src attribute, second custom block load the locale messge that defined only at single file component. These locale messages will be merged as locale message of component.
In this way, multiple custom blocks useful when want to be used as module.

hot-reload.html.body:
Hot reloading
You can watch for changes in localization files and hot reload changes into your application.
// Something locale messages
const messages = {
  // ...
}

// VueI18n instance
const i18n = new Vuei18n({
  locale: 'en',
  messages
})

// Run app
const app = new Vue({
  i18n,
  // ...
}).$mount('#app')

// Hot updates
if (module.hot) {
  module.hot.accept(['./en', './ja'], function () {
    i18n.setLocaleMessage('en', require('./en').default)
    i18n.setLocaleMessage('ja', require('./ja').default)
    // Or the following hot updates via $i18n property
    // app.$i18n.setLocaleMessage('en', require('./en').default)
    // app.$i18n.setLocaleMessage('ja', require('./ja').default)
  })
}

lazy-loading.html.body:
Lazy loading translations
Loading all of your translation files at once is overkill and unnecessary. Lazy loading or asynchronously loading the translation files is really easy when using Webpack.
Lets assume we have a project directory similar to the one bellow
our-cool-project
-dist
-src
--routes
--store
--setup
---i18n-setup.js
--lang
---en.js
---it.js
The lang folder is where all of our translation files will reside. 
The setup folder is where our arbitrary setup files like the i18n-setup, global component inits, plugin inits and other reside.
//i18n-setup.js
import Vue from 'vue'
import VueI18n from 'vue-i18n'
import messages from '@/lang'
import axios from 'axios'

Vue.use(VueI18n)

export const i18n = new VueI18n({
  locale: 'en', // set locale
  fallbackLocale: 'en',
  messages // set locale messages
})

const loadedLanguages = ['en'] // our default language that is prelaoded 

function setI18nLanguage (lang) {
  i18n.locale = lang
  axios.defaults.headers.common['Accept-Language'] = lang
  document.querySelector('html').setAttribute('lang', lang)
  return lang
}

export function loadLanguageAsync (lang) {
  if (i18n.locale !== lang) {
    if (!loadedLanguages.includes(lang)) {
      return import(/* webpackChunkName: "lang-[request]" */ `@/lang/${lang}`).then(msgs => {
        i18n.setLocaleMessage(lang, msgs.default)
        loadedLanguages.push(lang)
        return setI18nLanguage(lang)
      })
    } 
    return Promise.resolve(setI18nLanguage(lang))
  }
  return Promise.resolve(lang)
}

In short we are creating a new VueI18n instance as we normally would. Then we are creating a loadedLanguages array that will keep track of our loaded languages.
Next is the setI18nLanguage function that will actually change the language in our vueI18n instance, axios and where ever else is needed.
The loadLanguageAsync function is what we will actually use to change the languages. Loading the new files is done via the import function, which is generously provided by Webpack and it allows us to load files dynamically, and because it uses promises we can easily wait for the loading to finish.
You can learn more about the import function in the Webpack documentation.
Using the loadLanguageAsync function is straight forward. A common use case is inside a vue-router beforeEach hook.
router.beforeEach((to, from, next) => {
  const lang = to.params.lang
  loadLanguageAsync(lang).then(() => next())
})

We could improve this by checking if the lang is actually supported by us or not, call reject so we can catch that in the beforeEach stopping the route transition.

migrations.html.body:
Migrations
Global config
lang replaced
Use VueI18n class constructor locale option, or VueI18n#locale property:
  const i18n = new VueI18n({
    locale: 'en',
    // ...
  })
  const app = new Vue({ i18n }).$mount('#app')

  // change locale
  i18n.locale = 'ja'
  // or
  app.$i18n.locale = 'ja'

fallbackLang replaced
Use VueI18n class constructor fallbackLocale option, or VueI18n#fallbackLocale property:
  const i18n = new VueI18n({
    locale: 'ja',
    fallbackLocale: 'en',
    // ...
  })
  const app = new Vue({ i18n }).$mount('#app')

  // change fallback locale
  i18n.fallbackLocale = 'zh'
  // or
  app.$i18n.fallbackLocale = 'zh'

missingHandler replaced
Use VueI18n class constructor missing option, or VueI18n#missing property:
  const i18n = new VueI18n({
    // ...
    missing: (locale, key, vm) => {
      // handle translation missing
    },
    // ...
  })
  const app = new Vue({ i18n }).$mount('#app')

  // change missing handler
  i18n.missing = (locale, key, vm) => {
    // handle translation missing
  }
  // or
  app.$i18n.missing = (locale, key, vm) => {
    // handle translation missing
  }

i18nFormatter replaced
Use VueI18n class constructor formatter option, or VueI18n#formatter property:
  class CustomFormatter {
    format (message, ...values) {
      // something render logic
      return 'something string'
    }
  }

  const i18n = new VueI18n({
    // ...
    formatter: new CustomFormatter(),
    // ...
  })
  const app = new Vue({ i18n }).$mount('#app')

  // change custom formatter
  i18n.formatter = {
    format: (message, ...values) => {
      // something render logic
      return 'something string'
    }
  }
  // or
  app.$i18n.formatter = {
    format: (message, ...values) => {
      // something render logic
      return 'something string'
    }
  }

Global methods
Vue.locale replaced
Use VueI18n class constructor messages option, or VueI18n#GetLocaleMessage / VueI18n#setLocaleMessage methods:
  const i18n = new VueI18n({
    // ...
    messages: {
      en: {
        hello: 'hello world',
        // ...
      },
      ja: {
        hello: 'こんにちは、世界',
        // ...
      }
    },
    // ...
  })
  const app = new Vue({ i18n }).$mount('#app')

  // get locale message
  const en = i18n.getLocaleMessage('en')
  en.greeting = 'hi!'
  // set locale message
  i18n.setLocaleMessage('en', en)
  // or
  const ja = app.$i18n.getLocaleMessage('ja')
  ja.greeting = 'やあ！'
  app.$i18n.setLocaleMessage('ja', ja)

Vue.t replaced
Use VueI18n#t method:
  const i18n = new VueI18n({
    locale: 'en',
    messages: {
      en: {
        greeting: 'hi {name}'
      }
    },
    // ...
  })

  i18n.t('greeting', { name: 'kazupon' }) // -> hi kazupon

Vue.tc replaced
Use VueI18n#tc method:
  const i18n = new VueI18n({
    locale: 'en',
    messages: {
      en: {
        apple: 'no apples | one apple | {count} apples'
      }
    },
    // ...
  })

  const count = 10
  i18n.tc('apple', count, { count }) // -> 10 apples

Vue.te replaced
Use VueI18n#te method:
  const i18n = new VueI18n({
    locale: 'en',
    messages: {
      en: {
        hello: 'hello world'
      }
    },
    // ...
  })

  i18n.te('hello') // -> true
  i18n.te('hallo', 'ja') // -> false
  i18n.te('hello') // -> true

